import React from "react";
import Container from "react-bootstrap/Container";
import UserPosts from "./UserPosts";

export default class Profile extends React.Component {
  render() {
    return (
      <Container fluid id="profile">
        <h2>Bianca Catoto</h2>
        <UserPosts />
      </Container>
    );
  }
}
